INSERT INTO `catalogo_generale` (`id`, `codice_a_barre`, `descrizione`, `immagine`, `ristretto_per_minori`, `vendibile`, `vendibile_via_web`, `larghezza`, `profondita`, `prezzo`, `prezzo_scontato`, `iva_id`, `catalogo_tipologia_id`, `titolo`, `categoria`, `corrispettivi`, `brand`) VALUES
	(200, '8058664028108', 'Il test di gravidanza Analysis è un test qualitativo rapido per la determinazione della Gonadotropina Corionica umana (hCG) nell\'urina. Grazie all\'elevata sensibilità di questo test, è possibile determinare la gravidanza fin dal primo giorno della mancata mestruazione. Affidabilità superiore al 99%.', 'analysis_testgravidanza_1_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Analysis Test di Gravidanza 1 pz', 'test_diagnostici', 1, ''),
	(201, '8058664028115', 'Il test di gravidanza Analysis è un test qualitativo rapido per la determinazione della Gonadotropina Corionica umana (hCG) nell\'urina. Grazie all\'elevata sensibilità di questo test, è possibile determinare la gravidanza fin dal primo giorno della mancata mestruazione. Affidabilità superiore al 99%.', 'analysis_testgravidanza_2_large.png', 0, 1, 1, 1, 30, 1800, 1800, 1, 3, 'Analysis Test di Gravidanza 2 pz', 'test_diagnostici', 1, ''),
	(202, '8411134124371', 'Control Aloe Care sono i preservativi lubrificati con Aloe Vera e profumati al Gelsomino. Offrono un apporto di scorrevolezza in più rispetto ad un normale profilattico.', 'control_aloecare_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Aloe Care Profilattici 6 pz', 'profilattici', 1, 'control'),
	(203, '8411134140586', 'Confezione da 12 preservativi.\nControl Chocolate , è un profilattico dal piacevole e riconosciuto potere afrodisiaco dell\'aroma e colore del cioccolato.\nScopri una nuova passione con Control Chocolate Addiction. Control Chocolate Addiction è un profilattico in lattice di gomma naturale, sottile, liscio, anatomico, a lati non paralleli, trasparente, lubrificato e con serbatoio.', 'control_chocolate_12_large.png', 0, 1, 1, 1, 40, 1600, 1600, 1, 3, 'Control New Chocolate Profilattici 12 pz', 'profilattici', 1, 'control'),
	(204, '8411134140579', 'Control Chocolate Addiction ideali per un piacere sessuale ancora più intenso dato dal sapore gustoso afrodisiaco del cioccolato.', 'control_chocolate_6_large.png', 0, 1, 1, 1, 40, 1000, 1000, 1, 3, 'Control New Chocolate Profilattici 6 pz', 'profilattici', 1, 'control'),
	(205, '8411134119483', 'Control Essence Chocolate Addiction Profilattico aromatizzato al cioccolato.', 'control_chocolateaddiction_6_large.png', 0, 1, 1, 1, 25, 700, 700, 1, 3, 'Control Chocolate Addiction Profilattici 6 pz', 'profilattici', 1, 'control'),
	(206, '8058664108053', 'Mini stimolatore vaginale con superfici sferiche per un maggiore piacere\nSilicone medico molto morbido al tatto\n5 diverse vibrazioni\nFacile da usare: basta un pulsante per accendere, spegnere e cambiare la vibrazione\nPulsante con luce soffusa per l\'uso al buio', 'control_cosmicpleasure_large.png', 0, 1, 1, 1, 40, 2500, 2500, 1, 3, 'Control Cosmic Pleasure Vibratore', 'sex_toys', 1, 'control'),
	(207, '8058664130252', 'Stimolatore per clitoride e zone erogene\n5 diversi livelli di intensità che possono essere facilmente regolati\nSilicone medico molto morbido al tatto\nSommergibile sott\'acqua\nPrivo di ftalati e metalli pesanti', 'control_doublevibes_large.png', 0, 1, 1, 1, 35, 2500, 2500, 1, 3, 'Control Double Vibes', 'sex_toys', 1, 'control'),
	(208, '8411134119377', 'Rapporti più sicuri e intensi per entrambi i partner grazie a Control Energy. Energy Control è un preservativo in lattice di gomma naturale. Dotato di forma anatomica, Control si avvale della combinazione di un lubrificante speciale e di un dedalo di rilievi e nervature studiati per procurare il massimo piacere ad entrambi i partner.', 'control_energy_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Energy Profilattici 6 pz', 'profilattici', 1, 'control'),
	(209, '8411134135803', 'Gel massaggio idratande per il corpo per momenti di sensualità e divertimento\nCompatibile con il profilattico in caso di contatto\nA base acquosa, ipoallergenico, no fenossietanolo, no parabeni, 100 % Made in Italy', 'control_exoticescape_gel_large.png', 0, 1, 1, 1, 50, 1200, 1200, 1, 3, 'Control Exotic Escape Gel 200 ml', 'lubrificanti', 1, 'control'),
	(210, '8447190369319', 'Confezione da 12 pezzi \n\nLa forma speciale e la maggior lubrificazione Control Nature Xtra Lube consentono la massima adattabilità, rendendo il vostro rapporto più piacevole.', 'control_extralube_12_large.png', 0, 1, 1, 1, 40, 1600, 1600, 1, 3, 'Control New Extralube Profilattici 12 pz', 'profilattici', 1, 'control'),
	(211, '8411134139634', 'La forma speciale e la maggior lubrificazione Control Nature Xtra Lube consentono la massima adattabilità, rendendo il vostro rapporto più piacevole.', 'control_extralube_6_large.png', 0, 1, 1, 1, 25, 900, 900, 1, 3, 'Control New Extralube Profilattici 6 pz', 'profilattici', 1, 'control'),
	(212, '8058664108336', 'Vibratore 5 velocità\nUso: vagina, clitoride, anale\nPlastica ABS, silicone medicale ipoallergenico\nImpermeabile\nDimensioni 16 cm x 3,4 cm\nBatterie incluse', 'control_feelxl_large.png', 0, 1, 1, 1, 40, 0, 0, 1, 3, 'Control Feel XL Vibratore', 'sex_toys', 1, 'control'),
	(213, '8411134140234', 'Control Finissimo Original 12 Pezzi\nPiù aumentano le sensazioni, più è intenso il piacere: Finissimo Original 0.05 mm è un preservativo molto sottile e con forma anatomica che offre ottimale adattabilità ed elevata sensibilità durante il rapporto.', 'control_finissimo_12_large.png', 0, 1, 1, 1, 40, 1600, 1600, 1, 3, 'Control Finissimo Original Profilattici 12 Pezzi', 'profilattici', 1, 'control'),
	(214, '8411134140296', 'Il miglior preservativo di control. Il suo spessore super sottile rende facile godere della estrema sensibilità, mentre la sua forma ergonomica favorisce la massima adattabilità. Realizzato in lattice, con serbatoio e lubrificato.', 'control_finissimo_3_large.png', 0, 1, 1, 1, 25, 200, 200, 1, 3, 'Control Finissimo Profilattici 3 pz', 'profilattici', 1, 'control'),
	(215, '8411134140388', 'Control Sensivity Finissimo Senso 0.06mm preservativo sottile pensato per chi cerca una elevata sensibilità durante il rapporto.', 'control_finissimo_senso_12_large.png', 0, 1, 1, 1, 40, 1600, 1600, 1, 3, 'Control Finissimo Senso Profilattici 12 pz', 'profilattici', 1, 'control'),
	(216, '8411134140371', 'Control Sensivity Finissimo Senso 0.06mm preservativo sottile pensato per chi cerca una elevata sensibilità durante il rapporto.', 'control_finissimo_senso_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo Senso Profilattici 6 pz', 'profilattici', 1, 'control'),
	(217, '8411134140326', 'Il preservativo è più sottile del 30% rispetto alla gamma standard.\nGarantisce la massima sensibilità nelle relazioni grazie al suo spessore minimo.\nCon una lubrificazione ottimale.', 'control_finissimo_ultrafeel_10_large.png', 0, 1, 1, 1, 40, 1200, 1200, 1, 3, 'Control Finissimo Ultrafeel Profilattici 10 pz', 'profilattici', 1, 'control'),
	(218, '8411134140289', 'Control Sensivity Finissimo Ultrafeel 0.04mm è il preservativo più sottile della gamma e permette di vivere intensamente ogni momento di piacere.', 'control_finissimo_ultrafeel_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo Ultrafeel Profilattici 6 pz', 'profilattici', 1, 'control'),
	(219, '8411134140333', 'Control Finissimo XL è il miglior preservativo di Control e, a sua volta, più largo e più lungo dello standard.\nIl suo spessore ultrasottile facilita il piacere grazia a un\'estrema sensibilità, mentre il suo speciale design anatomico XL lo rende molto più comodo da posizionare e utilizzare.\nMassima sensibilità e adattabilità nello stesso preservativo.', 'control_finissimo_xl_12_large.png', 0, 1, 1, 1, 40, 1600, 1600, 1, 3, 'Control Finissimo Original XL Profilattici 12 pz', 'profilattici', 1, 'control'),
	(220, '8411134140340', 'Control Sensivity Finissimo Xtra Large è il profilattico con sensibilità e comfort durante il rapporto: molto sottile e con ampiezza e lunghezza superiore.', 'control_finissimo_xl_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo Original XL Profilattici 6 pz', 'profilattici', 1, 'control'),
	(221, '8411134126672', 'Profilattici super sottili e più facili da\nindossare. Più sensibilità senza interruzione.', 'control_finissimoeasyway_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo Easy Way Profilattici 6 pz', 'profilattici', 1, 'control'),
	(222, '8411134141354', 'Control Finissimo è il profilattico più sottile di Control. Il suo spessore super sottile garantisce un estrema sensibilità durante il rapporto, mentre la sua forma ergonomica consente un ottima adattabilità. Massima sensibilità e adattabilità in un unico profilattico. Control Adapta Finissimo è un profilattico in lattice di gomma naturale della massima qualità, sottile, liscio, anatomico, a lati non paralleli, trasparente, lubrificato e con serbatoio.', 'control_finissimoold_12_large.png', 0, 1, 1, 1, 40, 1700, 1700, 1, 3, 'Control Finissimo Profilattici 12 pz', 'profilattici', 1, 'control'),
	(223, '8411134119636', 'Profilattici adatti come contraccettivi e proteggono dalle malattie sessualmente trasmissibili. Lo spessore, quasi impercettibile, offre una grande sensibilità durante il rapporto mentre la forma ergonomica consente un\'ottimale adattabilità.', 'control_finissimoold_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo Profilattici 6 pz', 'profilattici', 1, 'control'),
	(224, '8411134140456', 'Finissimo Easy Way è pensato per chi cerca grandi sensazioni e spontaneità nei momenti di piacere: un preservativo sottile, con spessore ridotto rispetto ai modelli standard della linea Control, comodo da indossare grazie alla delicata linguetta che indica il verso giusto e permette di srotolarlo facilmente.', 'control_finissimooriginaleasyway_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo Original Easy Way Profilattici 6 pz', 'profilattici', 1, 'control'),
	(225, '8411134119605', 'Control Finissimo sono preservativi sottili e ultra sensibili: con uno spessore di 0,05 mm e una larghezza nominale di 54 mm, perfetti per le misure standard comode.', 'control_finissimoxlold_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Finissimo XL Profilattici 6 pz', 'profilattici', 1, 'control'),
	(226, '8411134119698', 'Profilattici adatti come contraccettivi e proteggono dalle malattie sessualmente trasmissibili. La forma particolare consente grande adattabilità. Caratterizzati da uno spessore maggiorato che nulla toglie alla sensibilità durante il rapporto, sono in lattice di gomma naturale, sottili, lisci, anatomici, a lati non paralleli, trasparenti, lubrificati e con serbatoio. Larghezza nominale 54 mm', 'control_forte_6_large.png', 0, 1, 1, 1, 25, 1000, 1000, 1, 3, 'Control Forte Profilattici 6 pz', 'profilattici', 1, 'control'),
	(227, '8411134140661', 'Control New Fusion 12 Pezzi\nUn\'esplosione di aromi afrodisiaci\nQuando si vuole aggiungere un tocco di fantasia ai momenti di piacere, Fussion è una scelta giusta: ogni confezione contiene preservativi con tre diversi aromi di cioccolato, pesca e menta, adatti per dare una dose di gusto al rapporto e risvegliare i sensi con colori e fragranze sempre nuovi', 'control_fussion_12_large.png', 0, 1, 1, 1, 40, 1600, 1600, 1, 3, 'Control Fussion Profilattici 12 pz', 'profilattici', 1, 'control'),
	(228, '8411134119612', 'Control Fussion è un profilattico in lattice di gomma naturale, sottile, liscio, anatomico, a lati non paralleli, con serbatoio, lubrificato con aroma al cioccolato, pesca o menta e di colore rispettivamente marrone, giallo o verde.', 'control_fussionold_12_large.png', 0, 1, 1, 1, 40, 1700, 1700, 1, 3, 'Control Fussion Profilattici 12 pz', 'profilattici', 1, 'control'),
	(229, '8411134138316', 'Dispositivo progettato per stimolare e aiutare la preparazione dell\'attività sessuale\nAiuta le donne a rafforzare i muscoli vaginali e pelvici attraverso la pratica di esercizi kegel\nLa pratica regolare di esercizi kegel può portare benefici per l\'elasticità vaginale\nContiene un sacchetto per riporlo', 'control_geishaballs_large.png', 0, 1, 1, 1, 50, 1000, 1000, 1, 3, 'Control Geisha Balls Sex Toy', 'sex_toys', 1, 'control'),
