	(349, '8004373032622', 'Durex Settebello Classico Profilattici è una confezione da 12 profilattici trasparenti e lubrificati in lattice di gomma naturale. Rappresenta l’originale e classico profilattico di Durex.', 'durex_settebelloold_12_large.png', 0, 1, 1, 1, 25, 1350, 1350, 1, 3, 'Durex Settebello Classico Profilattici 6 pz', 'profilattici', 1, 'durex'),
	(350, '5052197044850', 'Ritardante per lui, per favorire il piacere di coppia\nPreservativo con rilievi, nervature e il lubrificante Performa per un\'intensa esperienza di coppia\nSync è un profilattico ideato per la coppia, in grado di sincronizzare il piacere reciproco ristabilendo gli equilibri in amore', 'durex_sync_12_large.png', 0, 1, 1, 1, 40, 1800, 1800, 1, 3, 'Durex Sync Profilattici 12 pz', 'profilattici', 1, 'durex'),
	(351, '5052197003925', 'Durex Sync Profilattici Ritardanti è una confezione da 6 profilattici trasparenti e lubrificati in lattice di gomma naturale con crema ritardante con il 5% di benzocaina. Ideati per favorire il piacere di coppia: ritardanti per lui, stimolante per lei.', 'durex_sync_6_large.png', 0, 1, 1, 1, 25, 1200, 1200, 1, 3, 'Durex Sync Profilattici 6 pz', 'profilattici', 1, 'durex'),
	(352, '5038483445235', 'Durex Tropical Profilattici Aromatizzati è una confezione da 6 profilattici trasparenti e lubrificati in lattice di gomma naturale. Aromatizzati ai gusti di frutta: arancia, banana, fragola e mela.', 'durex_tropical_6_large.png', 0, 1, 1, 1, 25, 1100, 1100, 1, 3, 'Durex Topical Mix Profilattici 6 pz', 'profilattici', 1, 'durex'),
	(353, '5052197007084', 'Durex TVB Profilattici è una confezione da 6 profilattici trasparenti e lubrificati in lattice di gomma naturale che rende speciali e indimenticabili i primi amori.', 'durex_tvb_6_large.png', 0, 1, 1, 1, 25, 900, 900, 1, 3, 'Durex TVB Profilattici 6 pz', 'profilattici', 1, 'durex'),
	(354, '8058090004332', 'Test diagnostico rapido da eseguire a casa in totale autonomia, in grado di stabilire se vi è una gravidanza in corso individuando nell’urina la presenza o meno dell’ormone della gravidanza hCG.', 'pic_testgravidanza_1_large.png', 0, 1, 1, 1, 40, 1500, 1500, 1, 3, 'Pic Test di Gravidanza 1 pz', 'test_diagnostici', 1, 'pic'),
	(355, '8056860820274', 'Triplice azione: protettiva favorente la riparazione, emolliente e di conseguenza anti-irritativa e lubrificante.\nL’acido ialuronico grazie alle sue proprietà di immagazzinare l’acqua crea un film protettivo sulla mucosa esofagea che ne favorisce di conseguenza i processi di riparazione\nIl complesso vegetale grazie all’azione emolliente contribuisce a ridurre l’irritazione della mucosa esofagea\nL’effetto filmante di ￼ favorisce l’azione lubrificante\nNon contiene glutine.\nGavirepair è un dispositivo medico CE0476. Leggere attentamente le avvertenze e le istruzioni per l’uso. Autorizzazione del 05.08.2021.', 'gaviscon_gavirepair10_large.png', 0, 1, 1, 1, 55, 2000, 2000, 1, 3, 'Gaviscon - Gavirepair 10 ml 20 bustine', 'farmaci_automedicazione', 1, 'gaviscon'),
	(356, '8002910046972', 'Idrata e lenisce la secchezza nelle zone intime, ridonando comfort\nÈ stato specificamente progettato per essere vicino alla naturale lubrificazione del vostro corpo\nIdratante e confortevole\nIncolore e indolore\nConservare in luogo fresco e asciutto e lontano dalla portata del sole', 'durex_sensilube_large.png', 0, 1, 1, 1, 40, 1500, 1500, 1, 3, 'Durex Sensilube Gel 40 ml', 'lubrificanti', 1, 'durex'),
	(357, '8056860820526', 'FORMULA IPOALLERGENICA- Con il 50% in meno di ingredienti chimici rispetto alle altre strisce Veet, queste sono adatte anche alle pelli più sensibili e minimizzano il rischio di reazioni allergiche\nRIMUOVONO I PELI ALLA RADICE- al contrario dei rasoi, le strisce depilatorie Veet rimuovono i peli alla radice, fornendo risultati duraturi, fino a 28 giorni\nADERISCONO ANCHE AI PELI PIÙ CORTI- e non alla pelle, lasciandola idratata ed esfoliata\nPRONTE ALL\'USO - le strisce arrivano incollate 2 a 2 e non è necessario strofinarle prima di separarle\nFACILI DA UTILIZZARE- basta separare le strisce, applicarle sulla pelle nella direzione di crescita dei peli, strofinare ripetutamente e strappare in direzione opposta', 'veet_striscecorpo_large.png', 0, 1, 1, 1, 30, 700, 700, 1, 3, 'Veet Strisce Ipoallergeniche Corpo 16 pz', 'accessori', 1, 'veet'),
	(358, '8056860820540', 'FORMULA IPOALLERGENICA- Con il 50% in meno di ingredienti chimici rispetto alle altre strisce Veet, queste sono adatte anche alle pelli più sensibili e minimizzano il rischio di reazioni allergiche\nRIMUOVONO I PELI ALLA RADICE- al contrario dei rasoi, le strisce depilatorie Veet rimuovono i peli alla radice, fornendo risultati duraturi, fino a 28 giorni\nADERISCONO ANCHE AI PELI PIÙ CORTI- e non alla pelle, lasciandola idratata ed esfoliata\nPRONTE ALL\'USO - le strisce arrivano incollate 2 a 2 e non è necessario strofinarle prima di separarle\nFACILI DA UTILIZZARE- basta separare le strisce, applicarle sulla pelle nella direzione di crescita dei peli, strofinare ripetutamente e strappare in direzione opposta', 'veet_strisceviso_large.png', 0, 1, 1, 1, 30, 700, 700, 1, 3, 'Veet Strisce Ipoallergeniche Viso 16 pz', 'accessori', 1, 'veet'),
	(359, '8056860820502', 'Formula in gel Easy-Gel: aderisce ai peli più corti, non alla pelle, 1,5 mm, rimuove i peli alla radice, per una pelle liscia fino a 28 giorni. Garantisce ottimi risultati fin dal primo utilizzo, anche per chi non ha mai provato le strisce depilatorie. Queste strisce sono state studiate per permettere l’utilizzo su aree delicate e di piccole dimensioni come le ascelle.', 'veet_strisceascelle_large.png', 0, 1, 1, 1, 30, 700, 700, 1, 3, 'Veet Strisce Ipoallergeniche Ascelle 16 pz', 'accessori', 1, 'veet'),
	(360, '3059946316383', 'Compresse effervescenti adatte alla pulizia delle protesi dentarie.\nElimina la placca ed esercita un\'azione antibatterica fino a 12 ore.\nDona una sensazione di freschezza.\nLe parti metalliche della dentiera, grazie alla loro formula anticorrosione, rimangono sempre lucenti.\n1 Confezione da 60 Compresse da conservare in un luogo fresco e asciutto.', 'steradent_express60_large.png', 0, 1, 1, 1, 40, 900, 900, 1, 3, 'Steradent Express 60 compresse', 'ortodonzia', 1, 'steradent'),
	(361, '3059946240633', 'Compresse effervescenti adatte alla pulizia delle protesi dentarie.\nElimina la placca ed esercita un\'azione antibatterica fino a 12 ore.\nDona una sensazione di freschezza.\nLe parti metalliche della dentiera, grazie alla loro formula anticorrosione, rimangono sempre lucenti.\n1 Confezione da 90 Compresse da conservare in un luogo fresco e asciutto.', 'steradent_express90_large.png', 0, 1, 1, 1, 40, 1200, 1200, 1, 3, 'Steradent Express 90 compresse', 'ortodonzia', 1, 'steradent');
